import React from "react";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer_container container">
        <h1 className="footer_title">Violet Nguyen</h1>
        <ul className="footer_list"></ul>
      </div>
    </footer>
  );
};

export default Footer;
